document.addEventListener('DOMContentLoaded', () => {
    setTimeout(() => {
        document.querySelector('.container').classList.add('visible');
    }, 100);
});

const width = 900;
const height = 900;
const radius = Math.min(width, height) / 2 - 120;

const svg = d3.select(".timeline-container")
    .append("svg")
    .attr("width", width)
    .attr("height", height)
    .append("g")
    .attr("transform", `translate(${width / 2},${height / 2})`);

const timeScale = d3.scaleLinear()
    .domain([0, events.length])
    .range([0, 2 * Math.PI]);

const arc = d3.arc()
    .innerRadius(radius * 0.65)
    .outerRadius(radius)
    .startAngle((d, i) => timeScale(i))
    .endAngle((d, i) => timeScale(i + 0.95))
    .padAngle(0.04)
    .cornerRadius(8);

// Add marker path generator
const markerArc = d3.arc()
    .innerRadius(radius * 0.6)
    .outerRadius(radius * 1.08)
    .startAngle(d => d)
    .endAngle(d => d + 0.02);

// Add the current time marker
const marker = svg.append("path")
    .attr("class", "time-marker")
    .attr("d", markerArc(0))
    .style("opacity", 0);

// Enhanced gradients with softer colors
const defs = svg.append("defs");

const filter = defs.append("filter")
    .attr("id", "glow");
filter.append("feGaussianBlur")
    .attr("stdDeviation", "3")
    .attr("result", "coloredBlur");
const feMerge = filter.append("feMerge");
feMerge.append("feMergeNode")
    .attr("in", "coloredBlur");
feMerge.append("feMergeNode")
    .attr("in", "SourceGraphic");

events.forEach((event, i) => {
    const gradient = defs.append("linearGradient")
        .attr("id", `gradient-${i}`)
        .attr("gradientUnits", "userSpaceOnUse")
        .attr("x1", "0%")
        .attr("y1", "0%")
        .attr("x2", "100%")
        .attr("y2", "100%");

    // Convert event colors to softer pastel shades
    const baseColor = d3.color(event.color);
    const lightColor = d3.hsl(baseColor);
    lightColor.s *= 0.8;
    lightColor.l = 0.7;

    // gradient.append("stop")
    //     .attr("offset", "0%")
    //     .attr("stop-color", d3.color(event.color).brighter(0.5));

    // gradient.append("stop")
    //     .attr("offset", "100%")
    //     .attr("stop-color", event.color);

    gradient.append("stop")

        .attr("offset", "0%")

        .attr("stop-color", lightColor.toString());



    gradient.append("stop")

        .attr("offset", "100%")

        .attr("stop-color", d3.hsl(baseColor).brighter(0.5));
});

function showEventDetails(event, d, i) {
    const angle = timeScale(i + 0.5);

    // Animate marker to current position
    gsap.to(marker.node(), {
        duration: 0.5,
        attr: { d: markerArc(angle) },
        opacity: 1,
        ease: "power2.out"
    });

    // Rest of your existing showEventDetails code...
    gsap.to(this, {
        duration: 0.3,
        scale: 1.05,
        ease: "power2.out"
    });

    const details = d3.select(".event-details");
    details.classed("visible", false);

    gsap.to(details.node(), {
        duration: 0.3,
        opacity: 0,
        scale: 0.95,
        onComplete: () => {
            d3.select(".event-time").text(d.time);
            d3.select(".event-image").attr("src", d.image);
            d3.select(".event-title").text(d.title);
            d3.select(".event-description").text(d.description);

            details.classed("visible", true);
            gsap.to(details.node(), {
                duration: 0.5,
                opacity: 1,
                scale: 1,
                ease: "back.out(1.7)"
            });
        }
    });
}

// Add arcs with enhanced animations
const arcs = svg.selectAll("path.timeline-arc")
    .data(events)
    .enter()
    .append("path")
    .attr("d", arc)
    .attr("class", "timeline-arc")
    .attr("fill", (d, i) => `url(#gradient-${i})`)
    // .style("opacity", 0)
    .attr("class", "timeline-arc")
    .style("filter", "url(#glow)")
    .on("mouseover", function (event, d, i) { showEventDetails.call(this, event, d, i); })
    .on("mouseout", function () {
        if (!autoplayActive) {
            gsap.to(this, {
                duration: 0.3,
                scale: 1,
                ease: "power2.out"
            });
        }
    });

